                          "\n\nLes pr\u00e9sentes CGS Clients constituent le contrat conclu entre NETIR et le Client et ont pour objet de d\u00e9terminer les conditions dans lesquelles NETIR propose au Client de lui fournir les Services sur la Plateforme.\r\n\r\n\rElles s'appliquent sans restriction ni r\u00e9serve \u00e0 l'ensemble des op\u00e9rations propos\u00e9es par NETIR sur la Plateforme, \u00e0 l\u2019exception toutefois des conditions de prestations du Freelance avec lequel le Client entre dans une relation contractuelle directe \u00e0 l\u2019occasion du Contrat de prestations.\r\n\r\n\rEnfin, les Services de NETIR \u00e9tant destin\u00e9s \u00e0 une client\u00e8le exclusive de professionnels, \u00e0 savoir toute personne physique ou morale agissant \u00e0 des fins entrant dans le cadre de son activit\u00e9 commerciale, industrielle, artisanale, lib\u00e9rale ou agricole, NETIR se r\u00e9serve le droit de refuser, pour motif l\u00e9gitime, toute demande de cr\u00e9ation de Compte Client ou toute commande sur la Plateforme faite \u00e0 des fins non professionnelles."
